var fetch=require("node-fetch");
var Headers=require("node-fetch").Headers;

var Ac4yRestServiceClient=require("@ac4y/ac4y-service/domain/Ac4yRestServiceClient.js");

class GateRestServiceClient extends Ac4yRestServiceClient {

    async login(request) {return await this.post("/gate/login", request)}
    async getNextUser() {return await this.post("/gate/getnextuser")}
    async insertUser(request) {return await this.post("/gate/insertuser", request);}

    async loginNextUser() {return await this.get("/gate/loginnextuser")}
    async getWebsocketUserList() {return await this.get("/gate/websocket/user")}

}; // GateRestServiceClient

module.exports=GateRestServiceClient